import{_ as a,c as i,o as t,ag as e}from"./chunks/framework.V1ghUkRo.js";const p="/tutorials/assets/branch_1.CQyVmg-w.png",l="/tutorials/assets/branch_2.D03_AWYe.png",h="/tutorials/assets/branch_merge.BDaVlyWH.png",n="/tutorials/assets/branch_save-merge-msg.B9L0uDiT.png",d="/tutorials/assets/branch_3.DkdnRATH.png",F=JSON.parse('{"title":"分支","description":"","frontmatter":{},"headers":[],"relativePath":"startup/git/branch.md","filePath":"startup/git/branch.md"}'),o={name:"startup/git/branch.md"};function r(c,s,k,g,m,u){return t(),i("div",null,[...s[0]||(s[0]=[e('<h1 id="分支" tabindex="-1">分支 <a class="header-anchor" href="#分支" aria-label="Permalink to &quot;分支&quot;">​</a></h1><h2 id="分支为何物" tabindex="-1">分支为何物？ <a class="header-anchor" href="#分支为何物" aria-label="Permalink to &quot;分支为何物？&quot;">​</a></h2><p>举个栗子，你是某茄某点某横某江的小说家，你的热门小说即将连载下一章并且已经写好了初稿。但是你转念一想：如果换一个桥段会不会更好一点呢？读者会不会更容易接受呢？于是聪明的你从原稿件的某个时间点开始，接着此前的剧情开启了另一条 if 线，然后顺利地接回了主线剧情。</p><p>Git 中的分支（branch）就是此般存在。在团队协作中，主分支多用于存放较稳定的代码，而<strong>处于开发中的部分一般需要单独创建一个分支</strong>，等到完成度较高了再合并进入主分支。</p><h2 id="开一个新分支" tabindex="-1">开一个新分支 <a class="header-anchor" href="#开一个新分支" aria-label="Permalink to &quot;开一个新分支&quot;">​</a></h2><p>书接上回，你退回了状态 1，但它也是主分支上的一个提交，接下来就用 <code>git checkout</code> 指令从这里单独开一个名为 <code>dev</code> 的开发分支吧。</p><div class="language-shell vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">shell</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">git</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> checkout</span><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;"> -b</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> dev</span></span></code></pre></div><p><em>注：创建新的不存在的分支，需带上</em> <code>-b</code> <em>参数。</em></p><p>执行完这一步，Git 不但会创建分支，还会自动进入这个新的分支。你现在的状态应该是这样的 ↓ <img src="'+p+`" alt="原理图1-新建分支"></p><p>那么，做点不同于主分支上的更改吧！比如创建另外一个 321.txt 如何呢？</p><div class="language-shell vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">shell</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">git</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> add</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> 321.txt</span></span>
<span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">git</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> commit</span><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;"> -m</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> &quot;Not a hello&quot;</span></span></code></pre></div><p>这样一来，我们就在新分支创建了一个完全不同的新提交！ <img src="`+l+'" alt="原理图2-在新分支新建提交"></p><p>对了之前说到的怎么会到原来的分支的问题还没解决呢，现在我们先回到原分支吧。如果<a href="./index.html#windows-用户">安装的时候</a>默认分支名没有自定义的话，主分支应该是 <code>master</code>。</p><div class="language-shell vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">shell</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">git</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> checkout</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> master</span></span></code></pre></div><p>平稳落地！顺利回到主分支！</p><h2 id="合并分支" tabindex="-1">合并分支 <a class="header-anchor" href="#合并分支" aria-label="Permalink to &quot;合并分支&quot;">​</a></h2><p>接下来使用 <code>merge</code> 指令合并（merge）我们在 <code>dev</code> 分支上的提交吧~</p><div class="language-shell vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">shell</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">git</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> merge</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> dev</span></span></code></pre></div><p>你信心满满地按下回车，然后—— <img src="'+h+'" alt="合并分支"></p><p>嗯？嗯嗯？这是什么！？</p><p>记得你<a href="./index.html#windows-用户">安装的时候</a>选择的文本编辑器吗？这就是几乎纯键盘交互的文本编辑器 Vim！</p><p>回到这里，白色横条之上就是当前编辑的文档的内容，即合并消息。怎么编辑它呢？按住键盘上的 <kbd>I</kbd> 键即可进入编辑模式，然后你就可以按键盘的上下左右键移动光标当普通文本编辑器使用啦。带 # 号的内容就是合并消息的注释，不会被 Git 读取；而以 ~ 开头都是不存在的空行。</p><p>由于合并也是一种特殊的提交，这里写的合并消息跟你 <code>git commit -m</code> 里写的提交消息相当于一个东西。写完之后按 <kbd>Esc</kbd> 即可退出编辑模式。</p><p>但是！怎么保存呢？按 <kbd>:</kbd> 键进入命令模式，输入 <code>wq</code>，回车执行命令，即可保存并退出了。 <img src="'+n+'" alt="保存合并消息"></p><p>恭喜合并顺利结束！现在你的项目应该已经变成这个状态了 ↓ <img src="'+d+'" alt="原理图3-合并完成"></p><h2 id="合并后还要干嘛" tabindex="-1">合并后还要干嘛？ <a class="header-anchor" href="#合并后还要干嘛" aria-label="Permalink to &quot;合并后还要干嘛？&quot;">​</a></h2><p>不过！少侠请留步——合并完分支之后，我们创建的开发分支并不会被销毁。如果需要删掉这个分支，需要执行：</p><div class="language-shell vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">shell</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">git</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> branch</span><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;"> -D</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> dev</span></span></code></pre></div><p>如果需要继续在开发分支上开发新的东西，也可以用 <code>checkout</code> 回到开发分支。</p>',29)])])}const C=a(o,[["render",r]]);export{F as __pageData,C as default};
